// index.js

import React from 'react';
import ReactDOM from 'react-dom/client';
import { Auth0Provider } from "@auth0/auth0-react";
import './index.css';
import App from './App';
import authConfig from './auth_config.json'; // If you are using the auth_config.json

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <Auth0Provider
            domain={authConfig.domain}
            clientId={authConfig.clientId}
            redirectUri={`${window.location.origin}/chat`} // Redirect users to the /chat page after login
        >
            <App />
        </Auth0Provider>
    </React.StrictMode>
);
